import React from 'react'


export default function Video({video}) {

    return (
        <div className='card'>
           <video controls>
                <source src={require(`../video/${video.url}`).default}
                type="video/mp4"></source>
           </video>
            <h3>{video.name}</h3>
        </div>
    )
}
